import React from 'react';
import Link from 'next/link';

const linkStyle = {
  marginRight: 15,
};

const Header = () => (
  <div>
    <Link href="/">
      <p s style={linkStyle}>Home</p>
    </Link>
  </div>
);

export default Header;
